Описание:
Продается большой земельный участок 3,6 га.
Категория земли: Земли поселений (земли населенных пунктов), находится в стороне от села Нагорное.
Разрешение земли: животноводство, возможно поменять на другое. 
Участок расположен в зоне П-2 — зона промышленных предприятий II класса вредности. В ней разрешено развитие вспомогательных и сопутствующих основным производств, производств меньшего класса вредности. 

В такой зоне могут находиться, например:

административные и офисные здания; 
ведомственные научно-исследовательские институты и их производственные лаборатории; 
предприятия общественного питания; 
склады; 
объекты инженерного обеспечения предприятий; 
пожарные депо; 
открытые наземные стоянки; 
подземные и наземные паркинги.
Размер санитарно-защитной зоны (СЗЗ) от предприятий в такой зоне составляет 500 метров. 

На территории стоит тп на 150 кВт.
Есть фундамент от ангара на 1000 кв.м.
Несколько подъездных путей, можно огородить себя полностью от проездных дорог.

